import * as React from "react";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import ClientsTableRow from "./ClientsTableRow";

function createData(name, status, isEnrolled, date, contact) {
  return { name, status, isEnrolled, date, contact };
}

const rows = [
  createData(
    "John Max",
    "Information Session",
    "No",
    "2023-01-02",
    "john.max@yahoo.com"
  ),
  createData(
    "Lily Mon",
    "Application Approved",
    "Yes",
    "2023-02-03",
    "301-233-1234"
  ),
];

export default function BasicTable() {
  return (
    <TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell align="center">Name</TableCell>
            <TableCell align="center">Status</TableCell>
            <TableCell align="center">Is Enrolled?</TableCell>
            <TableCell align="center">Latest Updated Date</TableCell>
            <TableCell align="center">Contact</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <ClientsTableRow client={row} />
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
